dECLARE @DataImportPayoutHistory AS [TYPE_DATA_IMPORT_PAYOUTHISTORY]

update @DataImportPayoutHistory set [YEAR] = LTRIM(RTRIM([Year]))
update @DataImportPayoutHistory set [Plan] = LTRIM(RTRIM([Plan]))
update @DataImportPayoutHistory set MeasureName = LTRIM(RTRIM(MeasureName))
update @DataImportPayoutHistory set [Freq] = LTRIM(RTRIM([Freq]))

EXEC Proc_ImportUserPayoutHistory  @DataImportPayoutHistory
UPDATE [User] SET LoginID=CONCAT(LOginID,'@syngenta.org') where LoginID not like '%syngenta.org'